import React from 'react';



function Shayari({ id, title, author, content, likes, dislikes, onLike, onDislike }) {
    return (
        <div className='shayari-card'>
            <h2>{title}</h2>
            <h4>{author}</h4>
            <p>{content}</p>
            <div className="shayari-actions">
                <button className="like-button" onClick={onLike}></button> {likes}
                <button className="dislike-button" onClick={onDislike}></button> {dislikes}
                <button>Comments</button>
            </div>
        </div>
    );
}

export default Shayari;
